import React from "react";
import LogoImg from "../img/logo.svg";
import NikeImg from "../img/nike.png";

const Card = () => {
  const colors = [
    { value: "#b6a179" },
    { value: "#272425" },
    { value: "#6389cb" },
    { value: "#f2c7558" },
    { value: "#ffffff" },
  ];
  return (
    <div>
      <div className="w-[426px] min-h-[600px] bg-[#e4dfdc]">
        <div>logo</div>
        <div>title</div>
        <div>subtitle</div>
        <div>
          <button>button</button>
          <div>price</div>
        </div>
        <ul>colors</ul>
      </div>
    </div>
  );
};

export default Card;
